import './App.css';
import { Home } from './pages/Home';
import { CategoryProvider ,useCategory} from './context/category-context';
function App() {
  const {hotelCategory} = useCategory() 
  return (
    <>
    <CategoryProvider value={hotelCategory}>
    <Home/>
    </CategoryProvider>
  
    </>
  )
}

export default App;
